      hv_ImageWidth.Dispose();
      hv_ImageHeight.Dispose();
      hv_MinImageSize.Dispose();
      hv_Zs.Dispose();
      hv_ZDiff.Dispose();
      hv_ScaleZ.Dispose();
      hv_ZNew.Dispose();

      throw HDevExpDefaultException;
    }
