      {


        ho_Image.Dispose();hv_Estado.Dispose();hv_Exception.Dispose();hv_ConteoFotoPatron_New.Dispose();
        {
        HTuple ExpTmpOutVar_0;hv_g_Error_CamaraOpt_Adq.Dispose();
