        hv_Area.Dispose();hv_Row.Dispose();hv_Column.Dispose();
        HOperatorSet.AreaCenter(ho_ConnectedRegions, out hv_Area, out hv_Row, out hv_Column);
        hv_AlturaLocalizadores.Dispose();
