          {
          {
          HTuple 
            ExpTmpLocalVar_Conteo = hv_Conteo+1;
          hv_Conteo.Dispose();
          hv_Conteo = ExpTmpLocalVar_Conteo;
          }
          }
          hv_FXcheck.Dispose();
          hv_FXcheck = 1;
        }

