        {

          hv_FXcheck.Dispose();
          hv_FXcheck = 0;
        }
        else
        {
          hv_FXcheck.Dispose();
          hv_FXcheck = 1;
        }

      }
      // catch (Exception) 
      catch (HalconException HDevExpDefaultException1)
      {
        HDevExpDefaultException1.ToHTuple(out hv_Exception);

      }
      //
      //
      //
      //

      hv_Peticion.Dispose();
      hv_Data.Dispose();
      hv_VarSerial.Dispose();
      hv_Conteo.Dispose();
      hv_Nchar.Dispose();
      hv_Variable.Dispose();
      hv_Substrings.Dispose();
      hv_Exception.Dispose();

