      hv_Peticion.Dispose();
      hv_Data.Dispose();
      hv_VarSerial.Dispose();
      hv_Conteo.Dispose();
      hv_Nchar.Dispose();
      hv_Variable.Dispose();
      hv_Substrings.Dispose();
      hv_Exception.Dispose();

      return;
    }
