      {
      HObject ExpTmpOutVar_0;hv_row1_L.Dispose();hv_col1_L.Dispose();hv_CentroX_L.Dispose();hv_CentroY_L.Dispose();hv_CentroZ_L.Dispose();hv_Nelementos_Left.Dispose();
