        return;
      }




      if ((int)(new HTuple(hv_Nelementos_Left.TupleEqual(1))) != 0)
      {

        //*******************************
        //Angle := 0
        //*******************************
        hv_Base_esquina.Dispose();
        HOperatorSet.CreatePose(hv_CentroX_L, hv_CentroY_L, hv_CentroZ_L, 0, 0, hv_Angle, 
            "Rp+T", "gba", "point", out hv_Base_esquina);


