      {
      hv_MensajeError = (((((("### ERROR ### "+hv_ErrorMsg0)+" IN ")+hv_ErrorMsg1)+" IN FUNTION ")+hv_ErrorMsg2)+" IN LINE ")+hv_ErrorMsg3;
      }
      hv_Mensaje.Dispose();
