      //global tuple g_CamInBasePose1
      //global tuple g_CamInBasePose2


      HOperatorSet.CreatePose(0, 0, 0, 0, 0, 0, "Rp+T", "gba", "point", out ExpTmpLocalVar_g_CamInBasePose1);
